import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const Dashboard = () => {
    const { user, fetchUserProfile, fetchRoutines } = useAuth();
    const [profile, setProfile] = useState(null);
    const [routines, setRoutines] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const loadData = async () => {
            try {
                setLoading(true);
                const profileData = await fetchUserProfile();
                setProfile(profileData);
                
                const routinesData = await fetchRoutines();
                setRoutines(routinesData || []);
            } catch (error) {
                console.error('Error loading dashboard data:', error);
            } finally {
                setLoading(false);
            }
        };
        
        loadData();
    }, [fetchUserProfile, fetchRoutines]);

    if (loading) {
        return (
            <div className="min-h-screen bg-gray-50 pt-8">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <h1 className="text-3xl font-bold text-gray-900">Loading dashboard...</h1>
                </div>
            </div>
        );
    }

    return (
        <div className="min-h-screen bg-gray-50 pt-8">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                <div className="bg-white shadow overflow-hidden sm:rounded-lg mb-6">
                    <div className="px-4 py-5 sm:px-6 flex justify-between items-center">
                        <div>
                            <h2 className="text-2xl font-bold leading-7 text-gray-900 sm:text-3xl sm:truncate">
                                Welcome, {profile?.name || 'User'}!
                            </h2>
                            <p className="mt-1 max-w-2xl text-sm text-gray-500">
                                {profile?.email}
                            </p>
                        </div>
                        <Link
                            to="/profile"
                            className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                        >
                            Edit Profile
                        </Link>
                    </div>
                </div>

                {/* User's Routines */}
                <div className="bg-white shadow overflow-hidden sm:rounded-lg">
                    <div className="px-4 py-5 sm:px-6 flex justify-between items-center">
                        <h3 className="text-lg leading-6 font-medium text-gray-900">
                            Your Skincare Routines
                        </h3>
                        <Link
                            to="/routine"
                            className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                        >
                            Create New Routine
                        </Link>
                    </div>
                    
                    {routines.length === 0 ? (
                        <div className="px-4 py-5 sm:p-6">
                            <div className="text-center">
                                <p className="mt-1 text-sm text-gray-500">
                                    You haven't created any routines yet.
                                </p>
                                <div className="mt-6">
                                    <Link
                                        to="/routine"
                                        className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                                    >
                                        Create Your First Routine
                                    </Link>
                                </div>
                            </div>
                        </div>
                    ) : (
                        <div className="grid grid-cols-1 gap-4 sm:grid-cols-2 lg:grid-cols-3 p-4">
                            {routines.map((routine) => (
                                <div 
                                    key={routine.id} 
                                    className="bg-white overflow-hidden shadow rounded-lg border border-gray-200"
                                >
                                    <div className="px-4 py-5 sm:p-6">
                                        <h4 className="text-lg font-medium text-gray-900">{routine.name}</h4>
                                        <p className="mt-1 text-sm text-gray-500">
                                            Created: {new Date(routine.created_at).toLocaleDateString()}
                                        </p>
                                        <div className="mt-4">
                                            <h5 className="text-sm font-medium text-gray-900">Steps:</h5>
                                            <ul className="mt-2 divide-y divide-gray-200">
                                                {routine.steps.map((step, index) => (
                                                    <li key={index} className="py-2">
                                                        <div className="flex items-center">
                                                            <span className="inline-flex items-center justify-center h-6 w-6 rounded-full bg-indigo-100 text-indigo-800 mr-3">
                                                                {index + 1}
                                                            </span>
                                                            <span className="text-sm text-gray-500">{step}</span>
                                                        </div>
                                                    </li>
                                                ))}
                                            </ul>
                                        </div>
                                        {routine.products && routine.products.length > 0 && (
                                            <div className="mt-4">
                                                <h5 className="text-sm font-medium text-gray-900">Products:</h5>
                                                <ul className="mt-2 divide-y divide-gray-200">
                                                    {routine.products.map((product, index) => (
                                                        <li key={index} className="py-2 text-sm text-gray-500">
                                                            {product.name || product}
                                                        </li>
                                                    ))}
                                                </ul>
                                            </div>
                                        )}
                                    </div>
                                </div>
                            ))}
                        </div>
                    )}
                </div>
                
                {/* Recommendations section */}
                <div className="mt-8 bg-white shadow overflow-hidden sm:rounded-lg">
                    <div className="px-4 py-5 sm:px-6">
                        <h3 className="text-lg leading-6 font-medium text-gray-900">
                            What would you like to do?
                        </h3>
                    </div>
                    <div className="grid grid-cols-1 gap-4 sm:grid-cols-2 p-4">
                        <div className="bg-gray-50 overflow-hidden shadow rounded-lg">
                            <div className="px-4 py-5 sm:p-6">
                                <h4 className="text-lg font-medium text-gray-900">Skin Analysis</h4>
                                <p className="mt-1 text-sm text-gray-500">
                                    Analyze your skin type and get personalized recommendations
                                </p>
                                <div className="mt-4">
                                    <Link
                                        to="/analyzer"
                                        className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                                    >
                                        Analyze My Skin
                                    </Link>
                                </div>
                            </div>
                        </div>
                        <div className="bg-gray-50 overflow-hidden shadow rounded-lg">
                            <div className="px-4 py-5 sm:p-6">
                                <h4 className="text-lg font-medium text-gray-900">Product Recommendations</h4>
                                <p className="mt-1 text-sm text-gray-500">
                                    Get recommendations based on your skin type and concerns
                                </p>
                                <div className="mt-4">
                                    <Link
                                        to="/recommender"
                                        className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                                    >
                                        Get Recommendations
                                    </Link>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
